import React from 'react';
import Link from '@material-ui/core/Link';
import { makeStyles } from '@material-ui/core/styles';
import Typography from '@material-ui/core/Typography';
import Title from './Title';

export default function PaperItem(props) {

  const classes = useStyles();
  switch (props.name) {
    case "sitePurpose":
      return (
        <React.Fragment>
          <Title>当サイトの目的</Title>
          <Typography component="p" variant="h8">
            井上昂のポートフォリオ。
          </Typography>
          <Typography component="p" variant="h8">
            2022年4月にフロントエンジニアとして転職できるよう活動中。 
          </Typography>
          <Typography component="p" variant="h8">
          </Typography>
        </React.Fragment>
        // <img src={`${process.env.PUBLIC_URL}/takashi_4.JPG`} alt="Logo" />


      );

    case "baseProfile":
      return (
        <React.Fragment>
          <Title>基本プロフィール</Title>
          <Typography component="p" variant="h8">
            1996年生まれ。<b>24才</b>。社会人3年目。
          </Typography>
          <Typography component="p" variant="h8">
            大学卒業後、保険系SIerに就職。
          </Typography>
          <Typography component="p" variant="h8">
            アプリケーション基盤Tで、<br />
            サーバーサイドエンジニアとして活躍。
          </Typography>
          <Typography component="p" variant="h8">
            フロントエンドの技術に興味を持ち、<br />
            独学でSPAアプリケーション構築技術を習得。
          </Typography>
          {/* <Typography color="textSecondary" className={classes.depositContext}>
              on 15 March, 2019
            </Typography>
            <div>
              <Link color="primary" href="#" onClick={preventDefault}>
                View balance
              </Link>
            </div> */}
        </React.Fragment>
      );


    default:
      return (
        <React.Fragment>
          あいうえお
        </React.Fragment>
      );
  }


}
